import React from 'react'

import Title from './../title'
import './styles.css'


function listener(){
    document.queryListener('.comments').addEventListener('wheel', (event) => {
        if(event.deltaY > 0){
            console.log("scrollUP")
        }else{
            console.log("scrollDown")
        }
    })
}

const WhatTheySay = () => {
    return (
        <>
            <div className="what-they-say">
                <div className="container">
                    <div className="row">
                        <Title>O que dizem sobre mim?</Title>
                    </div>

                    <div className="row">
                        <div className="comments">
                            <div className="comment">teste</div>
                            <div className="comment">teste</div>
                            <div className="comment">teste</div>
                            <div className="comment">teste</div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
export default WhatTheySay
